Nadat bij hun zoon kanker wordt geconstateerd, besluiten Sara (Virginia Madsen) en Peter Campbell (Martin Donovan) dichtbij een 
speciale kliniek te gaan wonen. Er gebeuren echter vreemde onverklaarbare dingen in het huis, maar Sara en Peter schrijven die 
toe aan de stress door de omstandigheden. Maar dan blijkt dat het huis een voormalig mortuarium is, met een duister verleden.
